FeedPackage.Description:
添加微信登录

- 微信
    // 配置 
        app.UseWeixinAuthentication(new WeiXinAuthenticationOptions{
        AppId = "[you appId]", 
        AppSecret = "[you app Secret]"
    });  

    // 获取微信登录者信息
    var weixinInfo = await AuthenticationManager.GetExternalWeiXinLoginInfoAsync();

